  false,\n\t\"url\": null,\n\t\"notes\": \"The data contained in this file contain
  hydrographic and topographic data collected by the Fugro LADS Mk II system along
  the Lake Superior coast of Minnessota, Wisconsin and Michigan. FLI was contracted
  under Fugro Earth Data Inc (FEDI) by NOAA Office for Coastal Management (OCM) to
  collect data under the Great Lakes Restoration Initiative. All point data has delivered
  is in LAS 1.2 format The file has been classified so that all points are classified
  as first return or bare earth First return points include all vegetation, buildings
  or other feature with fixed position Bare earth points exclude vegetation, buildings,
  piers, jetties, nav aids, bridges and any other fixed man made feature. Except for
  break waters and retaining walls along the shore line.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
